import matht = int(input())out = open("output.txt", "w")out.write("Case #1:\n")def prime(x):    for i in range(2, 1000):        if x % i == 0:            return i    return Truedef work():    for i in range(1, t+1):        nj = input()        n = 32        j = 500                coinjam = 0        adder = 0        while coinjam < 500:            coin = "10000000000000000000000000000001"            coin = bin(int(coin,2)+adder)[2:]            while coin[-1] == "0":                coin = bin(int(coin,2)+1)[2:]                adder += 1            print(coin)            works = True            toPrint = coin + " "            for base in range(2, 10+1):                jam = int(coin, base)                divisor = prime(jam)                                                                       if divisor == True:                    works = False                    break                toPrint += str(divisor) + " "            if works == True:                out.write(toPrint[:-1] + "\n")                coinjam += 1            if coinjam >= 500:                return            adder += 1work()out.close()